import React from 'react';
import avatar from '../../images/Avatar.png'

function About() {
    return (
        <section id='about'>
            <div>
                <img id='avatar' src={avatar} alt='avatar' />
                <h1>About Me</h1>
                <p>This is some info about me</p>
            </div>
        </section>
    );
}

export default About;
